const HatsPage = (props) => {
  console.log(props);
  return <div>
          <h1>Hats Page</h1>
         </div>;
};

function App(props) {
  console.log(props);
  return (
    <div>
      <Switch>
        <Route exact path="/" component={HomePage}/>
        <Route exact path="/hats" component={HatsPage}/>
      </Switch>

    </div>
  );
}

export default App;
